function extractResults() {
  function getText(node) {
    if (!node) return '';
    return node.innerText || node.textContent || '';
  }
  function absUrl(url) {
    try { return new URL(url, location.origin).href; } catch { return url; }
  }
  var results = [];
  // 主体结果区块（去广告/精选）
  var rso = document.getElementById('rso');
  if (!rso) return results;
  var entries = Array.from(rso.querySelectorAll('div.MjjYud')).filter(function(div) {
    // 过滤掉非标准结构块等（避免QA/推荐/相关）
    return div.querySelector('h3') && div.querySelector('a[href]');
  });
  entries.forEach(function(entry, idx) {
    var a = entry.querySelector('a[href]');
    var titleEl = a.querySelector('h3') || a;
    var summaryEl = entry.querySelector('.VwiC3b, .VwiC3b.yXK7lf, .VwiC3b.p4wth');
    var citeEl = entry.querySelector('cite.qLRx3b');
    var siteNameEl = entry.querySelector('.VuuXrf');
    var faviconEl = entry.querySelector('img.XNo5Ab');
    // 标题
    var title = getText(titleEl).trim();
    // URL
    var url = absUrl(a.getAttribute('href'));
    // 摘要
    var summary = summaryEl ? getText(summaryEl).trim() : '';
    // 来源/显示短域名
    var source = siteNameEl ? getText(siteNameEl).trim() : '';
    var displayUrl = citeEl ? getText(citeEl).trim() : '';
    // favicon
    var faviconUrl = faviconEl ? faviconEl.src : undefined;
    results.push({
      url,
      title,
      summary,
      source,
      position: idx + 1,
      displayUrl,
      faviconUrl,
      siteName: source
    });
  });
  return results;
}

function extractGoogleSearchResults() {
  const results = [];
  const blocks = document.querySelectorAll('#search .MjjYud .A6K0A');
  let position = 1;
  blocks.forEach(block => {
    try {
      // 标题和URL
      const link = block.querySelector('a.zReHs');
      const titleNode = link ? link.querySelector('h3') : null;
      const url = link ? link.href : null;
      const title = titleNode ? titleNode.textContent.trim() : null;
      if (!url || !title) return;
      // 摘要
      let summary = null;
      const summaryDiv = block.querySelector('.VwiC3b');
      if (summaryDiv) summary = summaryDiv.innerText.trim();
      // 来源/站点名/展示URL
      let displayUrl = null, siteName = null, faviconUrl = null;
      const cite = block.querySelector('cite');
      if (cite) displayUrl = cite.textContent.trim();
      const siteSpan = block.querySelector('.VuuXrf');
      if (siteSpan) siteName = siteSpan.textContent.trim();
      const favImg = block.querySelector('img.XNo5Ab');
      if (favImg && favImg.src && favImg.src.startsWith('http')) faviconUrl = favImg.src;
      // 卡片图片
      let cardImageUrl = null;
      const cardImg = block.querySelector('img.XNo5Ab, img.lWlVCe');
      if (cardImg && cardImg.src && cardImg.src.startsWith('http')) cardImageUrl = cardImg.src;
      // 结果唯一id
      let id = null;
      if (link && link.id) id = link.id;
      // 标注/角标
      let badges = [];
      block.querySelectorAll('.QU4hqb, .jC6vSe').forEach(badge => {
        if (badge.innerText) badges.push(badge.innerText.trim());
      });
      // 排名（顺序）
      const result = {
        id: id||null,
        url,
        title,
        summary: summary||null,
        source: siteName||null,
        siteName: siteName||null,
        faviconUrl: faviconUrl||null,
        displayUrl: displayUrl||null,
        cardImageUrl: cardImageUrl||null,
        position,
        badges: badges.length ? badges : undefined
      };
      results.push(result);
      position++;
    } catch (e){}
  });
  return results;
}
